(1, 1, '2019-02-14 11:49:38', '2019-02-14 04:49:38', 'Selamat datang di WordPress. Ini adalah pos pertama Anda. Edit atau hapus pos ini, lalu mulailah menulis!', 'Halo dunia!', '', 'trash', 'open', 'open', '', 'halo-dunia__trashed', '', '', '2019-02-19 11:40:42', '2019-02-19 04:40:42', '', 0, 'http://localhost/wonosobo/?p=1', 0, 'post', '', 1),
(2, 1, '2019-02-14 11:49:38', '2019-02-14 04:49:38', 'Ini adalah contoh laman. Ini berbeda dengan posting blog karena akan tetap berada di satu tempat dan akan muncul di navigasi situs Anda (di kebanyakan tema). Kebanyakan orang memulai dengan laman Tentang yang mengenalkannya ke calon pengunjung situs. Biasanya terdengar seperti ini:\n\n<blockquote>Hai disana! Saya adalah pembawa sepeda siang hari, calon aktor di malam hari, dan ini adalah situs web saya. Saya tinggal di Los Angeles, punya anjing hebat bernama Jack, dan saya suka pia colada. (Dan tertangkap basah).</blockquote>\n\n... atau sesuatu seperti ini:\n\n<blockquote>The XYZ Doohickey Company didirikan pada tahun 1971, dan telah menyediakan doohickeys berkualitas kepada masyarakat sejak saat itu. Terletak di Gotham City, XYZ mempekerjakan lebih dari 2.000 orang dan melakukan segala hal yang mengagumkan untuk komunitas Gotham.</blockquote>\n\nSebagai pengguna WordPress baru, Anda harus membuka <a href=\"http://localhost/wonosobo/wp-admin/\">dasbor</a> untuk menghapus halaman ini dan membuat halaman baru untuk konten Anda. Selamat bersenang-senang!', 'Laman Contoh', '', 'trash', 'closed', 'open', '', 'laman-contoh__trashed', '', '', '2019-02-14 16:50:11', '2019-02-14 09:50:11', '', 0, 'http://localhost/wonosobo/?page_id=2', 0, 'page', '', 0),
(3, 1, '2019-02-14 11:49:38', '2019-02-14 04:49:38', '<h2>Siapa kami</h2><p>Alamat situs web kami adalah: http://localhost/wonosobo.</p><h2>Data pribadi apa yang kami kumpulkan dan mengapa kami mengumpulkannya</h2><h3>Komentar</h3><p>Saat pengunjung meninggalkan komentar pada situs, kita mengumpulkan data yang ditampilkan pada form komentar, alamat IP pengunjung dan user agent browser untuk membantu pendeteksian spam.</p><p>String anonim yang dibuat dari alamat email Anda (juga disebut hash) dapat diberikan ke layanan Gravatar untuk melihat apakah Anda menggunakannya. Kebijakan privasi layanan Gravatar tersedia di sini: https://automattic.com/privacy/. Setelah persetujuan atas komentar Anda, gambar profil Anda dapat dilihat oleh publik dalam konteks komentar Anda.</p><h3>Media</h3><p>Jika Anda mengunggah gambar ke situs web, Anda harus menghindari mengunggah gambar dengan data lokasi tertanam (GPS EXIF) yang disertakan. Pengunjung ke situs web dapat mengunduh dan mengekstrak data lokasi apa pun dari gambar di situs web.</p><h3>Formulir Kontak</h3><h3>Cookies</h3><p>Jika Anda meninggalkan komentar di situs kami, Anda dapat memilih untuk menyimpan nama, alamat email, dan situs web Anda dalam cookie. Ini untuk kenyamanan Anda sehingga Anda tidak perlu mengisi detail Anda lagi ketika Anda meninggalkan komentar lain. Cookie ini akan bertahan selama satu tahun.</p><p>Jika Anda memiliki akun dan masuk ke situs ini, kami akan menetapkan cookie sementara untuk menentukan apakah peramban Anda menerima cookie. Cookie ini tidak menyimpan data pribadi dan dibuang saat Anda menutup peramban Anda.</p><p>Saat Anda log masuk, kami akan menyiapkan beberapa cookie untuk menyimpan informasi log masuk Anda dan tampilan yang Anda pilih. Cookie log masuk berlaku selama dua hari, dan cookie pengaturan tampilan berlaku selama satu tahun. Jika Anda memilih &quot;Ingatkan Saya&quot;, log masuk anda akan bertahan selama dua minggu. Jika Anda log keluar dari akun, cookie log masuk akan dihapus.</p><p>Jika Anda menyunting atau menerbitkan artikel, cookie tambahan akan disimpan di browser Anda. Cookie ini tidak menyertakan data pribadi dan hanya menunjukkan ID posting dari artikel yang baru saja Anda sunting. Kadaluwarsa setelah 1 hari.</p><h3>Konten yang disematkan dari situs web lain</h3><p>Artikel-artikel di dalam situs ini dapat menyertakan konten terembed (seperti video, gambar, artikel, dll). Konten terembed dari situs web lain akan berlaku sama dengan pengunjung yang mengunjungi situs web lain.</p><p>Situs-situs web ini dapat mengumpulkan data tentang Anda, menggunakan cookies, menanamkan pelacak dari pihak ketiga, dan memonitor interaksi Anda dengan muatan tertanam, termasuk menggunakannya untuk melacak interaksi Anda jika Anda memiliki sebuah akun dan masuk ke dalam situs web tersebut.</p><h3>Analitik</h3><h2>Dengan siapa kami membagi data Anda</h2><h2>Berapa lama kami menyimpan data Anda</h2><p>Jika Anda meninggalkan komentar, komentar dan metadatanya dipertahankan tanpa batas. Ini agar kami dapat mengenali dan menyetujui komentar tindak lanjut secara otomatis dan tidak menahannya dalam antrean moderasi.</p><p>Untuk pengguna yang mendaftar pada website kami (jika ada), kami juga menyimpan informasi pribadi yang mereka berikan dalam profil pengguna mereka. Semua pengguna dapat melihat, mengedit, atau menghapus informasi pribadi mereka kapan saja (kecuali mereka tidak dapat mengubah nama pengguna mereka). Administrator situs juga dapat melihat dan mengedit informasi tersebut.</p><h2>Hak apa yang Anda miliki atas data ANda</h2><p>Jika anda mempunyai akun di situs ini, atau telah meninggalkan komentar, anda dapat meminta untuk mendapat data personal dalam file export dari kami, termasuk data yang anda berikan kepada kami. Anda juga dapat meminta kami menghapus data personal mengenai anda. Ini tidak termasuk data yang wajib kami simpan untuk keperluan administratif, hukum, atau keamanan.</p><h2>Ke mana kami kirim data Anda</h2><p>Komentar pengunjung dapat diperiksa melalui layanan deteksi spam otomatis.</p><h2>Informasi kontak Anda</h2><h2>Informasi tambahan</h2><h3>Bagaimana kami melindungi data Anda</h3><h3>Apa prosedur kebocoran data yang kami miliki</h3><h3>Pihak ketiga mana saja data yang kami terima berasal</h3><h3>Apa pengambilan keputusan otomatis dan/atau profil yang kami lakukan dengan data pengguna</h3><h3>Persyaratan pengungkapan regulasi industri</h3>', 'Kebijakan Privasi', '', 'draft', 'closed', 'open', '', 'kebijakan-privasi', '', '', '2019-02-14 11:49:38', '2019-02-14 04:49:38', '', 0, 'http://localhost/wonosobo/?page_id=3', 0, 'page', '', 0),
