(51, 1, '2019-02-15 09:52:48', '2019-02-15 02:52:48', '<strong>Apa sih idescafe itu?</strong>\r\n\r\n<img class=\"size-thumbnail wp-image-152 alignleft\" src=\"http://localhost/wonosobo/wp-content/uploads/2019/02/WhatsApp-Image-2019-02-11-at-13.25.23-150x150.jpeg\" alt=\"\" width=\"150\" height=\"150\" />Internet Desa Cafe atau yang biasa disebut dengan Idescafe merupakan salah satu layanan internet dari icon+ yang dapat diakses secara gratis selama satu tahun kedepan.\r\n\r\nsejumlah wilayah di indonesia saat ini sudah menikmati kehandalan jaringan internet icon+ yang bekerjasama dengan Pemerintahan Kota/ Pemerintahan Daerah seperti halnya di wonosobo ini. Dengan memanfaatkan Internet Desa Cafe (Idescafe), icon+ berharap seluruh desa di indonesia dapat memanfaatkan internet untuk memaksimalkan potensi daerah, memajukan perekonomian rakyat dan transparasi pelayanan publik.\r\n\r\ndibangun pada bulan februari 2019, pembangunan idescafe yang terletak di alun-alun wonosobo sudah langsung bisa digunakan mulai tanggal .. februari.Berita acara Pembangunan Ides Cafe diberikan oleh Enggineering Pembangunan PT Indonesia Comnet Plus, Arief Rizqy Kurniawan kepada ..., sebagai ... wonosobo. Dalam pembangunan ini, pihak desa hanya menyediakan lokasi, sedangkan kebutuhan lainnya dipenuhi oleh pihak PT.\r\n\r\nAdanya layanan internet gratis ini telah disosialisasikan kepada masyarakat. Internet dapat diakses selama 24 jam tanpa batasan pengguna dengan kecepatan hingga 15 Mbps. Suroto juga menuturkan agar masyarakat menggunakan layanan dengan bijak serta dapat membantu meningkatkan produktivitas desa. Selain itu, jaringan internet juga dimanfaatkan sebagai promosi potensi-potensi lokal, baik potensi wisata maupun kulinernya.\r\n\r\n<strong>Proses Pembangunan Idescafe</strong>\r\n\r\n<img class=\"size-thumbnail wp-image-144 alignleft\" src=\"http://localhost/wonosobo/wp-content/uploads/2019/02/WhatsApp-Image-2019-02-15-at-17.15.04-150x150.jpeg\" alt=\"\" width=\"150\" height=\"150\" /> <img class=\"size-thumbnail wp-image-145 alignleft\" src=\"http://localhost/wonosobo/wp-content/uploads/2019/02/WhatsApp-Image-2019-02-15-at-17.15.08-150x150.jpeg\" alt=\"\" width=\"150\" height=\"150\" /> <img class=\"size-thumbnail wp-image-146 alignleft\" src=\"http://localhost/wonosobo/wp-content/uploads/2019/02/WhatsApp-Image-2019-02-15-at-17.15.17-150x150.jpeg\" alt=\"\" width=\"150\" height=\"150\" />\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n<img class=\"size-thumbnail wp-image-147 alignleft\" src=\"http://localhost/wonosobo/wp-content/uploads/2019/02/WhatsApp-Image-2019-02-17-at-17.02.09-1-150x150.jpeg\" alt=\"\" width=\"150\" height=\"150\" /> <img class=\"size-thumbnail wp-image-148 alignleft\" src=\"http://localhost/wonosobo/wp-content/uploads/2019/02/WhatsApp-Image-2019-02-18-at-17.11.19-150x150.jpeg\" alt=\"\" width=\"150\" height=\"150\" /> <img class=\"size-thumbnail wp-image-149 alignleft\" src=\"http://localhost/wonosobo/wp-content/uploads/2019/02/WhatsApp-Image-2019-02-18-at-17.11.24-1-1-150x150.jpeg\" alt=\"\" width=\"150\" height=\"150\" />', 'IdesCafe', '', 'publish', 'closed', 'closed', '', 'idescafe', '', '', '2019-02-21 09:20:58', '2019-02-21 02:20:58', '', 12, 'http://localhost/wonosobo/?page_id=51', 4, 'page', '', 0),
