(71, 1, '2019-02-15 11:19:20', '2019-02-15 04:19:20', '<p style=\"text-align: left;\"><b>Wonosobo</b>adalah sebuah<a title=\"Kecamatan\" href=\"https://id.wikipedia.org/wiki/Kecamatan\">kecamatan</a>di<a title=\"Kabupaten Wonosobo\" href=\"https://id.wikipedia.org/wiki/Kabupaten_Wonosobo\">Kabupaten Wonosobo</a>,<a title=\"Jawa Tengah\" href=\"https://id.wikipedia.org/wiki/Jawa_Tengah\">Jawa Tengah</a>,<a title=\"Indonesia\" href=\"https://id.wikipedia.org/wiki/Indonesia\">Indonesia</a>. Kecamatan Wonosobo merupakan Ibukota<a title=\"Kabupaten Wonosobo\" href=\"https://id.wikipedia.org/wiki/Kabupaten_Wonosobo\">Kabupaten Wonosobo</a>. Luas wilayahnya sekira 33.00km yang terbagi menjadi 20<a title=\"Desa\" href=\"https://id.wikipedia.org/wiki/Desa\">desa</a>/<a title=\"Kelurahan\" href=\"https://id.wikipedia.org/wiki/Kelurahan\">kelurahan</a>. Jumlah penduduknya 86.977 jiwa (Laki-laki 43.862 jiwa dan Perempuan 43.115 jiwa)<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://id.wikipedia.org/wiki/Wonosobo,_Wonosobo#cite_note-1\">[1]</a></sup>. Pusat pemerintahan Kecamatan Wonosobo berada di<a title=\"Jaraksari, Wonosobo, Wonosobo\" href=\"https://id.wikipedia.org/wiki/Jaraksari,_Wonosobo,_Wonosobo\">Kelurahan Jaraksari</a>.</p>', 'Tentang', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2019-02-15 11:19:20', '2019-02-15 04:19:20', '', 41, 'http://localhost/wonosobo/2019/02/15/41-revision-v1/', 0, 'revision', '', 0),
