(93, 1, '2019-02-18 16:01:25', '2019-02-18 09:01:25', '<p style=\"text-align: center;\"><strong style=\"font-weight: 600;\">SEJARAH SINGKAT KABUPATEN WONOSOBO</strong></p>\r\n&nbsp;\r\n\r\nSejarah berdirinya Kabupaten Wonosobo tidak dapat dilepaskan dari kisah tiga pengembara, yang masuk ke wilayah ini pada awal abad 17 lalu. Ketiga orang itu, Kyai Kolodete, Kyai Karim, dan Kyai Walik, kemudian berpisah dan menempati tiga wilayah berbeda. Kyai Kolodete membuka permukiman di Dataran Tinggi Dieng, Kyai Karim di sekitar Kalibeber, dan Kyai Walik memilih wilayah yang kini menjadi Kota Wonosobo. Dari ketiga orang itu pula, muncuk anak keturunan yang di kelak kemudian hari menjadi para penguasa di seputar Wonosobo.\r\n<p style=\"font-weight: 300;\">Seperti salah seorang cucu Kyai Karim, yang sering juga disebut Ki Singowedono. Setelah mendapat hadiah dari Keraton Mataram, berupa sebuah wilayah di Selomerto, Ki Singowedono kemudian bergelar Tumenggung Jogonegoro. Jejak Tumenggung Jogonegoro dapat ditemukan di makamnya, di Desa Pakuncen, Selomerto.</p>\r\n<p style=\"font-weight: 300;\">Dari Selomerto itu pula, sejarah asal kata Wonosobo diyakini bermula. Banyak pihak meyakini, kata Wonosobo berasal dari sebuah dusun di Desa Polobangan, Selomerto. Dusun bernama Wanasaba tersebut didirikan oleh Kyai Wanasaba. Dusun kecil tersebut hingga kini masih ada, dan banyak dikunjungi para peziarah, yang ingin berdoa di makam Kyai Wanasaba, Kyai Goplem, Kyai Putih, dan Kyai Wan Haji.</p>\r\n<p style=\"font-weight: 300;\">Sejarah Kabupaten Wonosobo juga berkaitan erat dengan masa perang Diponegoro. Di rentang tahun 1825-1830, wilayah</p>\r\n<p style=\"font-weight: 300;\">Wonosobo menjadi salah satu basis pertahanan pasukan pendukung Pangeran Diponegoro. Bersama Imam Misbach, atau dikenal pula dengan nama Tumenggung Kertosinuwun, Tumenggung Mangkunegaran, dan Gajah Permodo, Kyai Muhammad Ngarpah berjuang melawan pendudukan Belanda di wilayah Wonosobo. Dalam sebuah pertempuran, Kyai Muhammad Ngarpah berhasil meraih kemenangan pertama, sehingga kemudian diberikan gelar Tumenggung Setjonegoro.</p>\r\n<p style=\"font-weight: 300;\">Tumenggung Setjonegoro, yang mengawali kekuasaannya berada di Ledok, Selomerto kemudian memindahkan pusat pemerintahan ke kawasan Kota Wonosobo sekarang, setelah menjadi Bupati pertama Wonosobo. Pemindahan pusat pemerintahan tersebut, setelah dikaji oleh Tim Peneliti dari Fakultas Sastra Universitas Gajah Mada (UGM) bersama Musyawarah Pimpinan Daerah (Muspida), para sesepuh dan beberapa tokoh, termasuk pimpinan dewan perwakilan rakyat, dalam sebuah seminar, pada 28 April 1994, kemudian diyakini terjadi pada tanggal 24 Juli 1825. Tanggal 24 Juli itu pula, yang kemudian diperingati setiap tahun sebagai Hari Jadi Kabupaten Wonosobo.</p>\r\n<p style=\"font-weight: 300;\">Adapun penguasa/kepala pemerintahan Kabupaten Wonosobo dari tahun 1825 sampai dengan sekarang adalah sebagai berikut :</p>\r\n\r\n<ul>\r\n 	<li style=\"font-weight: 300;\">Tumenggung R. Setjonegoro ( 1825 - 1832 )</li>\r\n 	<li style=\"font-weight: 300;\">Tumenggung R. MangoenKoesoemo ( 1832 - 1857 )</li>\r\n 	<li style=\"font-weight: 300;\">Tumenggung R. Kertonegoro ( 1857 - 1863 )</li>\r\n 	<li style=\"font-weight: 300;\">Tumenggung R. Tjokrohadisorjo ( 1863 - 1889 )</li>\r\n 	<li style=\"font-weight: 300;\">Tumenggung R. Soeryohadikoesoemo ( 1889 - 1898 )</li>\r\n 	<li style=\"font-weight: 300;\">Tumenggung R. Soerjohadinagoro ( 1898 - 1919 )</li>\r\n 	<li style=\"font-weight: 300;\">Adipati RAA Sosrodiprodjo ( 1920 - 1944 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati R. Singgih Hadipoero ( 1944 - 1946 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati R. Soemindro ( 1946 - 1950 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati R. Kadri ( 1950 - 1954 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati R. Oemar Soerjokoesoemo ( 1955 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati R. Sangidi Hadisoetirto ( 1955 - 1957 )</li>\r\n 	<li style=\"font-weight: 300;\">Kapala Daerah Rapingoen Wiombohadi Soedjono ( 1957 - 1959 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati R. Wibowo Helly ( 1960 - 1967 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati KDH Drs. R. Darodjat A.N.S ( 1967 -1974 )</li>\r\n 	<li style=\"font-weight: 300;\">Pj. Bupati KDH R. Marjaban ( 1974 - 1975 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati KDH Drs. Soekanto ( 1975 - 1985 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati KDH Drs. Poedjihardjo ( 1985 - 1990 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati KDH Drs. H. Soemadi ( 1990 - 1995 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati KDH Drs. Margono ( 1995 - 2000 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati Drs. Trimawan Nugrohadi ( 2001 - 2005 )</li>\r\n 	<li style=\"font-weight: 300;\">Bupati H.A. Kholiq Arif (2005  2015)</li>\r\n 	<li style=\"font-weight: 300;\">Bupati Eko Purnomo, SE., MM (2015  sekarang)</li>\r\n</ul>', 'Sejarah Wonosobo', '', 'publish', 'closed', 'closed', '', 'sejarah-wonosobo', '', '', '2019-02-19 10:28:14', '2019-02-19 03:28:14', '', 89, 'http://localhost/wonosobo/?page_id=93', 2, 'page', '', 0),
