(100, 1, '2019-02-19 10:17:45', '2019-02-19 03:17:45', '<p style=\"text-align: center;\"><strong>VISI</strong></p>\r\nTERWUJUDNYA WONOSOBO BERSATU UNTUK MAJU, MANDIRI DAN SEJAHTERA UNTUK SEMUA\r\n\r\n&nbsp;\r\n<p style=\"text-align: center;\"><strong>MISI</strong></p>\r\n\r\n<ol>\r\n 	<li>Meningkatkan produktifitas dan pendapatan masyarakat melalui kebijakan ekonomi kerakyatan dan peningkatan infrastruktur pedesaan dan perkotaan;</li>\r\n 	<li>Pengembangan perekonomian yang bertumpu pada perluasan pembangunan infrastruktur perdesaan dan perkotaan untuk pengembangan pertanian, perkebunan, peternakan, dan perikanan, dengan penekanan pada peningkatan pendapatan masyarakat;</li>\r\n 	<li>Pemerataan dan keseimbangan pembangunan secara berkelanjutan dengan meningkatkan investasi dan pemanfaatan sumberdaya alam secara rasional, efektif dan efisien untuk mengurangi kesenjangan antar wilayah dan memperluas lapangan kerja;</li>\r\n 	<li>Meningkatkan sumber daya manusia yang unggul, sehat dan berkualitas melalui program pendidikian dan kesehatan serta berprestasi di berbagai aspek kehidupan.</li>\r\n 	<li>Mewujudkan manajemen pemerintahan daerah yang profesional, kepemimpinan daerah yang efektif, kepemimpinan yang amanah dan pelayanan publik yang berkualitas.</li>\r\n</ol>', 'Visi & Misi', '', 'inherit', 'closed', 'closed', '', '91-revision-v1', '', '', '2019-02-19 10:17:45', '2019-02-19 03:17:45', '', 91, 'http://localhost/wonosobo/2019/02/19/91-revision-v1/', 0, 'revision', '', 0),
