(128, 1, '2019-02-20 14:01:57', '2019-02-20 07:01:57', 'Candi Arjuna merupakan salah satu candi di kompleks<a href=\"https://sejarahlengkap.com/bangunan/sejarah-candi-dieng\">Sejarah Candi Dieng</a>yang terletak di dataran tinggi dieng, perbatasan antara Kabupaten Wonosobo dan Banjarnegara. Candi dieng juga masuk ke dalam kelompok candi Arjuna, dimana terdapat candi  candi lain selain candi Arjuna, Seperti candi Semar, candi srikandi, Candi Sembrada, dan Candi Puntadewa. Kelompok candi Arjuna merupakan kelompok candi yang memiliki bentuk paling utuh jika dibandingkan dengan kelompok candi lain di kompleks Candi di dieng.\r\n\r\nCandi Arjuna sendiri merupakan salah satu<a href=\"https://sejarahlengkap.com/agama/hindu/candi-peninggalan-agama-hindu\">candi peninggalan agama hindu</a>yang beraliran Syiwa. Candi ini juga diperkirakan merupakan candi Hindu pertama di Jawa, yang dibanguna pada sekitar Abad ke-7 pada masa pemerintahan kerajaan Mataram Kuno.\r\n\r\nKompleks candi di dieng terutama candi Arjuna ditemukan pertama kali pada abad ke 19 tepatnya di tahun 1814. Dimana ditemukan oleh seorang tentara Belanda yang bernama Thedorf Van Elf. Ketika itu, candi Arjuna masih tergenang air saat Elf menemukanya. Kemudian baru 40 tahun kemudian upaya pemeliharaan candi Arjuna di lakukan, Pemeliharaan ini dimulai dengan mengeringkan air telaga di dieng oleh HC Cornelius yang berkebangsaan inggris, tepatnya pada tahun 1856.\r\n\r\nKemudian dilanjutkan lagi oleh J Van Kirnsberg yang berkebangsaan Belanda dengan dibantu oleh pemerintahan Hindia-Belanda saat itu. Setelah upaya pengeringan telaga dan juga pembersihan selesai,Kemudian Van Kirnsberg mengambil beberapa gambar dan juga catatan mengenai candi Arjuna pada awal penemuan.\r\n<h3>Lokasi Candi Arjuna</h3>\r\nCandi Arjuna terletak di dataran tinggi dieng yaitu berada di ketinggian sekitar 2.093 meter diatas permukaan laut (mdpl). Dimana Dieng merupakan dataran tinggi yang berada di antara dua kabupaten yaitu Kabupaten Wonosobo dan Kabupaten Banjarnegara, Jawa Tengah. Namun, Candi Arjuna sendiri masuk ke dalam wilayah administratif Kabupaten Banjarnegara, tepatnya di desa dieng Kulon, Kecamatan Batur, kabupaten Banjarnegara .\r\n\r\nDan Berikut adalah rute menuju candi Arjuna.\r\n\r\n<strong>1. Rute dari Jogjakata</strong>\r\n\r\nRute ini merupakan rute terpopuler untuk anda yang ingin mengunjungi candi Arjuna dari Kota-kota besar di Indonesia seperti Jakarta dan Surabaya. Karena banyak transportasi dari dan menuju ke jogja mulai dengan menggunkana kereta, bus, ataupun pesawat terbang.\r\n<ul>\r\n 	<li>Jika anda ingin pergi dari Yogyakarta dengan menggunakan Bus, Carilah bus dengan jurusan menuju Semarang / Magelang.</li>\r\n 	<li>Turun di Terminal Magelang, perjalanan memakan watu sekitar 1.5 jam</li>\r\n 	<li>Di terminal magelang, anda bisa mencari Bus menuju Wonosobo</li>\r\n 	<li>Turun di Terminal Wonosobo,dimana perjalanan memakan waktu sekitar 2 jam</li>\r\n 	<li>Cari Angkutan umum menuju terminal bus dieng-batur</li>\r\n 	<li>Dari Terminal Dieng Batur anda bisa mencari ojek untuk mencapai Candi arjuna</li>\r\n</ul>\r\n<strong>2. Rute dari Semarang</strong>\r\n\r\nSelain Yogyakarta, anda bisa dari semarang yang juga mudah diakses dari Jakarta maupun Surabaya\r\n<ul>\r\n 	<li>Anda bisa langsung mencari Bus dengan jurusan Semarang  Wonosobo  Purwokerto</li>\r\n 	<li>Dari terminal wonosobo, anda bisa langsung mencari terminal Dieng-Batur</li>\r\n</ul>\r\n<strong>3. Rute dari Surakarta</strong>\r\n\r\nJika dengan menggunakan angkutan umum dari kta Surakarta memang cukup sulit. Termudah adalah anda bisa menuju stasiun yogya dulu. Kemudian baru mengikuti rute dari Yogya menuju Candi arjuna. Jika anda ingin menggunakan kendaraan pribadi jalur kota yang bisa anda lalui adalah Solo ke Boyolali, Salatiga, Ambarawa, Secang, Temanggung, Parakan, Wonosbo, dieng. Untuk kemudian menuju candi Arjuan\r\n\r\n<strong>4. Rute dari Purwokerto</strong>\r\n\r\nUntuk menuju ke purwoketo, anda bisa menggunakan kereta api. Jika anda dari Jakarta rute dari purwokerto merupakan rute tercepat yang bisa dipilih. Setalah di Purwokert, anda bisa menggunakan bus umum jurusan purwokerto-wonosobo untuk selanjutnya setelah di terminal wonosobo, anda bisa naik bus menuju terminal dieng-batur', 'Candi Arjuna Dieng', '', 'publish', 'open', 'open', '', 'candi-arjuna-dieng', '', '', '2019-02-20 14:21:08', '2019-02-20 07:21:08', '', 0, 'http://localhost/wonosobo/?p=128', 0, 'post', '', 0),
