(131, 1, '2019-02-20 14:01:57', '2019-02-20 07:01:57', 'Candi Arjuna merupakan salah satu candi di kompleks<a href=\"https://sejarahlengkap.com/bangunan/sejarah-candi-dieng\">Sejarah Candi Dieng</a>yang terletak di dataran tinggi dieng, perbatasan antara Kabupaten Wonosobo dan Banjarnegara. Candi dieng juga masuk ke dalam kelompok candi Arjuna, dimana terdapat candi  candi lain selain candi Arjuna, Seperti candi Semar, candi srikandi, Candi Sembrada, dan Candi Puntadewa. Kelompok candi Arjuna merupakan kelompok candi yang memiliki bentuk paling utuh jika dibandingkan dengan kelompok candi lain di kompleks Candi di dieng.\r\n\r\nCandi Arjuna sendiri merupakan salah satu<a href=\"https://sejarahlengkap.com/agama/hindu/candi-peninggalan-agama-hindu\">candi peninggalan agama hindu</a>yang beraliran Syiwa. Candi ini juga diperkirakan merupakan candi Hindu pertama di Jawa, yang dibanguna pada sekitar Abad ke-7 pada masa pemerintahan kerajaan Mataram Kuno.\r\n\r\nKompleks candi di dieng terutama candi Arjuna ditemukan pertama kali pada abad ke 19 tepatnya di tahun 1814. Dimana ditemukan oleh seorang tentara Belanda yang bernama Thedorf Van Elf. Ketika itu, candi Arjuna masih tergenang air saat Elf menemukanya. Kemudian baru 40 tahun kemudian upaya pemeliharaan candi Arjuna di lakukan, Pemeliharaan ini dimulai dengan mengeringkan air telaga di dieng oleh HC Cornelius yang berkebangsaan inggris, tepatnya pada tahun 1856.\r\n\r\nKemudian dilanjutkan lagi oleh J Van Kirnsberg yang berkebangsaan Belanda dengan dibantu oleh pemerintahan Hindia-Belanda saat itu. Setelah upaya pengeringan telaga dan juga pembersihan selesai,Kemudian Van Kirnsberg mengambil beberapa gambar dan juga catatan mengenai candi Arjuna pada awal penemuan.\r\n<h3>Lokasi Candi Arjuna</h3>\r\nCandi Arjuna terletak di dataran tinggi dieng yaitu berada di ketinggian sekitar 2.093 meter diatas permukaan laut (mdpl). Dimana Dieng merupakan dataran tinggi yang berada di antara dua kabupaten yaitu Kabupaten Wonosobo dan Kabupaten Banjarnegara, Jawa Tengah. Namun, Candi Arjuna sendiri masuk ke dalam wilayah administratif Kabupaten Banjarnegara, tepatnya di desa dieng Kulon, Kecamatan Batur, kabupaten Banjarnegara .\r\n\r\nDan Berikut adalah rute menuju candi Arjuna.\r\n\r\n<strong>1. Rute dari Jogjakata</strong>\r\n\r\nRute ini merupakan rute terpopuler untuk anda yang ingin mengunjungi candi Arjuna dari Kota-kota besar di Indonesia seperti Jakarta dan Surabaya. Karena banyak transportasi dari dan menuju ke jogja mulai dengan menggunkana kereta, bus, ataupun pesawat terbang.\r\n<ul>\r\n 	<li>Jika anda ingin pergi dari Yogyakarta dengan menggunakan Bus, Carilah bus dengan jurusan menuju Semarang / Magelang.</li>\r\n 	<li>Turun di Terminal Magelang, perjalanan memakan watu sekitar 1.5 jam</li>\r\n 	<li>Di terminal magelang, anda bisa mencari Bus menuju Wonosobo</li>\r\n 	<li>Turun di Terminal Wonosobo,dimana perjalanan memakan waktu sekitar 2 jam</li>\r\n 	<li>Cari Angkutan umum menuju terminal bus dieng-batur</li>\r\n 	<li>Dari Terminal Dieng Batur anda bisa mencari ojek untuk mencapai Candi arjuna</li>\r\n</ul>\r\n<strong>2. Rute dari Semarang</strong>\r\n\r\nSelain Yogyakarta, anda bisa dari semarang yang juga mudah diakses dari Jakarta maupun Surabaya\r\n<ul>\r\n 	<li>Anda bisa langsung mencari Bus dengan jurusan Semarang  Wonosobo  Purwokerto</li>\r\n 	<li>Dari terminal wonosobo, anda bisa langsung mencari terminal Dieng-Batur</li>\r\n</ul>\r\n<strong>3. Rute dari Surakarta</strong>\r\n\r\nJika dengan menggunakan angkutan umum dari kta Surakarta memang cukup sulit. Termudah adalah anda bisa menuju stasiun yogya dulu. Kemudian baru mengikuti rute dari Yogya menuju Candi arjuna. Jika anda ingin menggunakan kendaraan pribadi jalur kota yang bisa anda lalui adalah Solo ke Boyolali, Salatiga, Ambarawa, Secang, Temanggung, Parakan, Wonosbo, dieng. Untuk kemudian menuju candi Arjuan\r\n\r\n<strong>4. Rute dari Purwokerto</strong>\r\n\r\nUntuk menuju ke purwoketo, anda bisa menggunakan kereta api. Jika anda dari Jakarta rute dari purwokerto merupakan rute tercepat yang bisa dipilih. Setalah di Purwokert, anda bisa menggunakan bus umum jurusan purwokerto-wonosobo untuk selanjutnya setelah di terminal wonosobo, anda bisa naik bus menuju terminal dieng-batur', 'Candi Arjuna Dieng', '', 'inherit', 'closed', 'closed', '', '128-revision-v1', '', '', '2019-02-20 14:01:57', '2019-02-20 07:01:57', '', 128, 'http://localhost/wonosobo/2019/02/20/128-revision-v1/', 0, 'revision', '', 0),
(132, 1, '2019-02-20 14:19:16', '2019-02-20 07:19:16', '<strong>Telaga Warna</strong> merupakan salah satu tempat wisata andalan yang terletak di Dieng Wonosobo, jawa tengah. Danau ini mempunyai nama Telaga warna pun bukan tanpa sebab, yaitu karena telaga ini mempunyai warna yang bisa berubah ubah. Telaga ini kadang berwarna hijau, kuning dan pelangi. Hal tersebut karena telaga tersebut terdapat kandungan sulfur yang cukup banyak dan ketika tersorot sinar matahari maka warna air tersebut akan berubah warna.\n\nTelaga warna juga merupakan telaga terluas yang ada di dataran tinggi diantara telaga telaga yang lain seperti telaga pengilon, telaga merdada dan masih banyak lagi. Telaga warna sendiri mempunyai luas kira 3 kali lapangan sepak bola.\n\nTelaga warna dieng terletak di ketinggian 2000 meter diatas permkaan laut. Telaga tersebut juga dikelilingi oleh bukit bukit yang indah yang cocok sebagai tempat untuk refreshing. Jika anda ingin mendapat sensai keindahan yang lebih, anda bisa menaiki salah satu bukit yang ada di telaga warana. Dan yang paling populer yaitu bukit ratapan angin. Dari situ lah anda bisa duduk di sebuah batu sambil menikmati telaga warna dari atas bukit.\n\nWaktu yang paling di rekomendsaikan untuk mengunjungi telaga warna adalah pada waktu pagi hingga siang hari. Soalanya kalo anda berkunjung di sore hari kemungkinan kawasan telaga di selimuti dengan kabut. Jika anda berkunjung ke telaga tersebut pada waktu pagi hingga siang maka anda akan bisa melihat telaga yang benar benar berwarna, karena pada waktu tersebut pancaran sinar matahari sedang terik teriknya.\n\nSelain terdapat telaga yang indah, disekitaran telaga tersebut juga terdapat berbagai macam goa yang bisa anda nikkmati, dinataranya yaitu goa semar, goa sumur eyang kumalasari, goa pengantin dan juga gua jaran. banyak keunikan dari masing masing gua tersebut, sperti goa semar yang mempunyai keunikan terdapat kolam yang kecil di dalam goa dan air tersebut di percaya dapat menyembuhkan berbagai macam penyakit dan jug dapat membuat kulit menjdi lebih cantih atau awet muda. Di depan goa semar juga terdapat patung semar yang membawa kendi.\n\n<strong>Harga Tiket</strong>\n\nUntuk harga tiket masuk pun tidak begitu mahal, beberapa bulan yang lalu saya dan teman teman berkunjung ke telaga tersebut di kenai harga tiket masuk sebesar Rp. 7000 per orang di tambah parkir untuk mobil sebesar 5000 rupiah dan 2000 rupiah untuk kendaraan roda dua.', 'Telaga Warna', '', 'inherit', 'closed', 'closed', '', '54-autosave-v1', '', '', '2019-02-20 14:19:16', '2019-02-20 07:19:16', '', 54, 'http://localhost/wonosobo/2019/02/20/54-autosave-v1/', 0, 'revision', '', 0),
