menyembuhkan berbagai macam penyakit dan jug dapat membuat kulit menjdi lebih cantih atau awet muda. Di depan goa semar juga terdapat patung semar yang membawa kendi.\r\n\r\n<strong>Harga Tiket</strong>\r\n\r\nUntuk harga tiket masuk pun tidak begitu mahal, beberapa bulan yang lalu saya dan teman teman berkunjung ke telaga tersebut di kenai harga tiket masuk sebesar Rp. 7000 per orang di tambah parkir untuk mobil sebesar 5000 rupiah dan 2000 rupiah untuk kendaraan roda dua.', 'Telaga Warna', '', 'inherit', 'closed', 'closed', '', '54-revision-v1', '', '', '2019-02-20 14:20:10', '2019-02-20 07:20:10', '', 54, 'http://localhost/wonosobo/2019/02/20/54-revision-v1/', 0, 'revision', '', 0),
(134, 1, '2019-02-20 14:58:54', '2019-02-20 07:58:54', 'Jika berkunjung ke Wonosobo, kurang lengkap rasanya jika tidak mencicipi kuliner khasnya: mie ongklok. Mie kuning dengan isian cacahan kol dan daun bawang, lalu disiram kuah kental gurih dan saus/sambal kacang. Mie ongklok paling lezat dinikmati bersama sate sapi dan tempe<em>kemul</em>.\r\n\r\nKenapa disebut Mie Ongklok? Ternyata karena sebelum disajikan mie ini diramu dengan sayuran kol segar dan potongan daun kucai. Kol dan daun kucai merupakan sayuran khas Wonosobo. Kucai sendiri adalah daun yang terkenal sebagai penurun darah tinggi.\r\n\r\nOngklok adalah semacam keranjang kecil dari anyaman<a title=\"Bambu\" href=\"https://id.wikipedia.org/wiki/Bambu\">bambu</a>yang dipakai untuk membantu perebusan mi. Penggunaan alat bantu ini khas daerah setempat sehingga diberikanlah nama mi rebus ini sesuai dengan alat tersebut.\r\n\r\nKemudian setelah dicampur di sebuah gayung dari bambu, campuran mie dan sayuran tadi dicelup-celupkan selama beberapa menit di air mendidih, dan cara inilah yang disebut diongklok. Mie yang secara berulang-ulang dicelupkan di air mendidih. Dan cara pembuatan mie yang seperti ini hanya ada di Wonosobo.Hanya beberapa menit, mie dan campuran sayuran tadi ditaruh di mangkuk dan diguyur kuah. Kuah mie ongklok inilah yang terkenal khas. Kuahnya berasal dari pati yang dicampur gula jawa, ebi, serta rempah. Supaya rasanya lebih maknyus, mie ongklok diguyur juga oleh bumbu kacang. Agar lebih segar lagi, kami menambahkan merica dan bawang goreng, kata Waluyo.Penyajian<i>Mie Ongklok</i>khas Wonosobo sendiri juga tergolong cukup unik. Ada beberapa varian lauk yang disajikan bareng Mie Ongklok, diantaranya sate sapi, tempe kemul, dan geblek atau semacam makanan dari singkong.Ketika menyentuh lidah, kuah mie ongklok ini sangat segar. Kesegaran mie ongklok ini karena ada campuran ebi. Setelah dirasakan bersama lauknya, kelezatan pun bertambah. Sate sapi yang empuk dan tempe kemul yang renyah menyatu dengan rasa mie ongklok yang sedap dan segar. Hmmm rasanya sangat menggugah selera.Untuk harga Mie Ongklok sendiri sangatlah terjangkau sekali. 1 porsi Mie Ongklok hanya Rp 5.000. Sedangkan untuk Sate Sapi harganya Rp 15.000/10 tusuk sate dan untuk geblek&amp;tempenya seharga Rp 500/bijinya. Jadi para penelusur nggak usah khawatir, karena tidak perlu mengeluarkan uang banyak untuk menikmatinya.', 'Mie Ongklok Kuliner Wonosobo', '', 'publish', 'open', 'open', '', 'mie-ongklok-kuliner-wonosobo', '', '', '2019-02-20 14:58:54', '2019-02-20 07:58:54', '', 0, 'http://localhost/wonosobo/?p=134', 0, 'post', '', 0),
