(137, 1, '2019-02-20 15:18:51', '2019-02-20 08:18:51', '<h3><span id=\"Lokasi_Lubang_Sewu_Erorejo\" class=\"ez-toc-section\"><strong>Lokasi Lubang Sewu Erorejo</strong></span></h3>\r\nLubang Sewu terletak di Desa Erorejo Kecamatan Wadaslintang Wonosobo tepatnya di area sekitar waduk Wadaslintang, Untuk menuju ke destinasi ini kalian pergi ke area perbatasan antara Wonosobo dan Kebumen. Untuk perjalanan dari Kota Wonosobo melewati arah Banjarnegara hingga sampai perempatan Sawangan, lalu melewati Kaliwiro dan menuju ke Wadaslintang, sudah terpampang jelas tulisan Desa Wisata Erorejo Lubang Sewu, jarak yang ditempuh jika melalui Wonosobo sekitar 43 km.\r\n\r\nSejarah adanya lubang sewu di Erorejo memang belum diketahui, namun tempat ini sudah ada sejak jaman dahulu sebagai tempat untuk memancing ikan dari warga setempat, lubang sewu juga belum banyak diliput oleh media karena baru diresmikan pada tahun 2015 . Antusias warga mulai ada ketika pengunjung Lubang Sewu Erorejo semakin banyak apalagi mendekati hari libur, ribuan wisatawan datang ke tempat ini untuk menikmati keindahan batu karangnya dan pemandangan waduk wadaslintang, tidak sedikit dari mereka berfoto ria dan menyebarkan keindahan lubang sewu ke media sosial. Asal muasal nama lubang sewu berasal dari cerita masyarakat sekitar saat keadaan air surut kadang terlihat ribuan lubang dan batu yang terkikis oleh air seperti karang atau seperti grand canyon berukuran kecil dan indah, tempat wisata ini dikatakan destinasi musiman karena kadang bebatuan tersebut tenggelam saat musim hujan. Di Desa Erorejo juga terdapat sekumpulan nelayan air tawar yang memiliki anggota sekitar 40 kepala keluarga yang biasa berpenghasilan dari ikan di Waduk Wadaslintang, saat musim ikan melimpah dalam satu hari bisa menghasilakan 1 Kwt ikan segar, tidak heran jika banyak orang yang memiliki hobi memancing berkunjung ke tempat ini hanya untuk menikmati indahnya Erorejo sekaligus menyalurkan hobi memancingnya. Baca Juga :<a href=\"https://mytrip123.com/tempat-wisata-di-malang-dan-sekitarnya/\" target=\"_blank\" rel=\"noopener\">Wisata Malang Yang Banyak dikunjungi</a>\r\n<h3><span id=\"Apa_Saja_yang_Ada_di_Lubang_Sewu_Erorejo\" class=\"ez-toc-section\"><strong>Apa Saja yang Ada di Lubang Sewu Erorejo?</strong></span></h3>\r\nWisata Lubang Sewu Erorejo memang tergolong baru dan dikenal karena banyaknya foto pengunjung yang datang ke tempat tersebut dan disebar ke media sosial maupun dari mulut ke mulut, banyak kalangan muda yang datang ke destinasi wisata Erorejo karena keindahan batu karangnya yang kadang terlihat seperti grand canyon mini cantik berwarna putih. Bebatuan yang membentuk seribu lubang cantik inilah yang banyak dicari oleh pemburu destinasi wisata, apalagi ditambah saat pemandangan matahari tenggelam di sore hari membuat wisata Erorejo lebih cantik nan indah. Beberapa fasilitas yang di dapat adalah :\r\n<ul>\r\n 	<li>Keindahan Waduk Wadaslintang</li>\r\n 	<li>Bebatuan lubang sewu</li>\r\n 	<li>Pemandangan matahari tenggelam di atas Waduk</li>\r\n 	<li>Lokasi pemancingan</li>\r\n 	<li>Gazebo</li>\r\n 	<li>Bukit Hijau</li>\r\n 	<li>kuliner warung makan khas Wonosobo</li>\r\n 	<li>mushola</li>\r\n 	<li>WC</li>\r\n 	<li></li>\r\n</ul>', 'Wisata Lubang Sewu', '', 'publish', 'open', 'open', '', 'wisata-lubang-sewu', '', '', '2019-02-20 15:18:51', '2019-02-20 08:18:51', '', 0, 'http://localhost/wonosobo/?p=137', 0, 'post', '', 0),
