(158, 1, '2019-02-21 09:36:06', '2019-02-21 02:36:06', '<div id=\"content\">\r\n<div class=\"post-content\">\r\n\r\nTempat yang paling banyak menjadi kenangan dan menjadi favorit wisatawan asing dalam perjalanan menuju Dieng adalah Gardu Pandang Tieng (GPT). Terletak pada ketinggian 1789 Mdpl tepat berada di atas Desa Tieng, lokasi ini merupakan lokasi yang paling tepat untuk menyaksikan terbitnya matahari dan menjadi lokasi alternatif bagi yang ingin melihat golden sunrise tapi tidak sempat naik ke bukit Sikunir, hampir setiap pagi sehabis subuh sudah ada orang yang berada dilokasi ini untuk menikmati keindahan terbitnya matahari tanpa penghalang apapun.\r\n\r\nPemandangan sebelah timur adalah perbukitan kebiruan yang diselimuti kabut tipis dan kalau melongok kebawah maka akan kita dapati pemandangan pedesaan dengan rumah rumah beratap seng hitam menjadi sajian pemandangan indah, sedangkan sebelah selatan terpampang didepan mata pemandangan gunung sindoro yang menjulang tinggi dengan anggunnya, warnanya kebiruan dan berlatar langit biru jernih sementara itu desa Tieng dan sekitarnya terselimuti kabut yang rata sampai pertengahan gunung Sindoro, berada di sini seolah kita sedang berada diatas awan, pantas saja banyak orang memberi julukan Dieng itu negeri atas awan, bagi yang belum pernah berada di gardu pandang Tieng, sepertinya sulit untuk mempercayai fenomena alam ini.\r\n\r\nKetika matahari mulai meninggi, petani beriringan menuju ladang, berpakaian tebal-tebal dan berselendang sarung , tangannya menenteng bekal makanan, tampak kesederhanaan dan kesahajaan hidup dari wajah-wajah mereka yang setiap hari melintasi sekitar gardu pandang Tieng ini. wisatawan biasanya tidak menyia-nyiakan kesempatan untuk mengabadikan wajah-wajah petani itu.\r\n\r\nTampak disebelah barat ada bukit Sikunir,gunung Pakuwojo dan ladang-ladang milik petani terhampar dengan aneka tanaman sayuran yang menghijau. terlihat juga jalan setapak berkelok-kelok yang menuju ke desa tertinggi dipulau Jawa.\r\n\r\nGardu Pandang Tieng juga sering menjadi tempat yang disediakan untuk menyambut tamu-tamu penting di Kabupaten Wonosobo dan Banjarnegara, seperti pada saat kedatangan 7 duta besar Negara sahabat, Gubernur, pejabat dari pusat dan orang-orang penting lainnya. Dengan lokasi yang mudah sekali untuk dijangkau, tidak perlu mengeluarkan tenaga untuk menikmati pemandangan langka berupa terbitnya matahari terbit dan awan yang berarak-arakan membentuk luiksan alam.\r\n\r\n</div>\r\n</div>', 'Gardu Pandang Dieng Wonosobo', '', 'inherit', 'closed', 'closed', '', '156-revision-v1', '', '', '2019-02-21 09:36:06', '2019-02-21 02:36:06', '', 156, 'http://localhost/wonosobo/2019/02/21/156-revision-v1/', 0, 'revision', '', 0),
(159, 1, '2019-02-21 09:43:18', '2019-02-21 02:43:18', '<h3>Informasi Umum</h3>\r\nObjek Wisata Curug Sirawe di Wonosobo Jawa Tengah adalah salah satu tempat wisata yang berada di Dusun Bitingan, Kecamatan Kepakisan, Jawa Tengah, Indonesia. Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah adalah tempat wisata yang ramai dengan wisatawan pada hari biasa maupun hari liburan. Tempat ini sangat indah dan bisa memberikan sensasi yang berbeda dengan aktivitas kita sehari hari.\r\n\r\nObjek Wisata Curug Sirawe di Wonosobo Jawa Tengah memiliki pesona keindahan yang sangat menarik untuk dikunjungi. Sangat di sayangkan jika anda berada di kota Wonosobo tidak mengunjungi Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah yang mempunyai keindahan yang tiada duanya tersebut.\r\n\r\nObjek Wisata Curug Sirawe di Wonosobo Jawa Tengah sangat cocok untuk mengisi kegiatan liburan anda, apalagi saat liburan panjang seperti libur nasional, ataupun hari ibur lainnya. Keindahan Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah ini sangatlah baik bagi anda semua yang berada di dekat atau di kejauhan untuk merapat mengunjungi tempat Objek Wisata Curug Sirawe di kota Wonosobo.\r\n<h3>Lokasi</h3>\r\nDimana lokasi Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah ? seperti yang tertulis di atas lokasi terletak di Dusun Bitingan, Kecamatan Kepakisan, Jawa Tengah, Indonesia. Tetapi jika anda masih bingung di mana lokasi atau letak Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah saya sarankan anda mencari dengan mengetik Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah di search google maps saja. Di Google maps sudah tertandai dimana lokasi yang anda cari tersebut.\r\n<h3>Daya Tarik</h3>\r\nObjek Wisata Curug Sirawe di Wonosobo Jawa Tengah merupakan tempat wisata yang harus anda kunjungi karena pesona keindahannya tidak ada duanya. Penduduk lokal daerah Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah juga sangat ramah tamah terhadap wisatawan lokal maupun wisatawan asing.\r\n\r\nKota Wonosobo juga terkenal akan Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah yang sangat menarik untuk dikunjungi. Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah ini terletak di Dusun Bitingan, Kepakisan. Dapat ditempuh melewati jalur Kawah Sileri kearah barat. Mulai dari Bitingan Anda harus berjalan kaki, melewati jalan\r\nmenantang dengan medan yang sangat terjal.\r\n\r\nSelama 40 menit perjalanan,\r\nhutan-hutan kuno dan gemuruh suara air terjun menjadi suguhan luar\r\nbiasa. Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah memiliki jalan yang petualangan sesungguhnya, menguji setiap nyali dan fisik seorang yang hoby menjelajah alam liar. Namun pemandangan disana sangatlah mempesona dengan keindahan alam yang masih sangat alami.\r\n<h3>Fasilitas</h3>\r\nObjek Wisata Curug Sirawe di Wonosobo Jawa Tengah bisa dibilang sebuah wisata alam yang memiliki beberapa akan fasilitas dan pelayanan di antaranya sebagai berikut :  Area Parkir kendaraan  Kamar mandi / MCK  Tempat Istirahat  dan masih ada lainya\r\n<h3>Transportasi</h3>\r\nBagi wisatawan asal kota Wonosobo sudah tidak bingung lagi untuk mendatangi lokasi Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah. Akan tetapi bagaimana bagi wisatawan luar kota bahkan luar negeri, tentu mereka bingung dan takut kesasar. Tapi jangan khawatir bagi wisatawan luar kota Wonosobo saya mempunyai solusinya agar anda semua tidak kesasar.\r\n\r\nTentunya sarana transportasi apa yang anda pakai untuk berwisata ke Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah dengan memakai kendaraan pribadi seperti : Mobil atau motor pribadi. Anda bisa meminta panduan arah ke Objek Wisata Curug Sirawe di Wonosobo Jawa Tengah di google maps yang terpasang di smartphone anda. Karena memakai kendaraan pribadi akan lebih menyenangkan dari pada memakai kendaraan umum.\r\nAkan tetapi jika anda memakai kendaraan umum seperti : bis umum atau angkutan lainnya juga bukan masalah besar, pasalnya anda bisa berhenti di terminal bus kota Wonosobo. Setelah itu melanjutkan dengan menggunakan ojek ataupun kendaraan pribadi anda menuju lokasi Objek Wisata Curug Sirawe di Wonosobo tersebut.\r\n<div class=\"separator\"></div>', 'Curug Sirawe', '', 'publish', 'open', 'open', '', 'curug-sirawe', '', '', '2019-02-21 09:44:08', '2019-02-21 02:44:08', '', 0, 'http://localhost/wonosobo/?p=159', 0, 'post', '', 0),
