(163, 1, '2019-02-21 10:04:15', '2019-02-21 03:04:15', 'Telaga Cebong Dieng Wonosobo merupakan kawasan wisata yang berada di Desa Sembungan yakni desa tertinggi di pulau Jawa. Karena letaknya di ketinggian, udaranya pastilah sangat sejuk dan udaranya pun segar.\r\n\r\nWisata alami ini memiliki akses cukup sulit, sehingga masih jarang mendapat perhatian wisatawan yang melakukan tour ke Dieng. Namun, sebenarnya kawasannya sangat menakjubkan dan bisa menjadi rekreasi berkesan saat menghabiskan waktu liburan.\r\n\r\n<strong>Daya Tarik Telaga Cebong Dieng Wonosobo</strong>\r\n\r\nPertama kali saat kamu tiba di Telaga Cebong Dieng akan merasakan hawa dingin. Kamu akan melihat dan menikmati kabut, tempat ini benar-benar sangat dingin. Jika sedang musim dingin tiba suhu bisa mencapai 0 celcius bahkan minus. Bentuknya yang menyerupai berudu atau kecebong, cebongan atau cebong, sehingga diberikan nama telaga cebong. Di pagi hari, airnya tampak berkilauan bagaikan minyak kalau dilihat dari jalan ke Gunung Sikunir. Hal ini menjadi view terbaik dan sering diabadikan oleh para wisatawan. Menikmati suasana sekitar, terasa menyegarkan pikiran. Bunuh hawa dinginnya dengan menyaksikan pemandangan alam dan saling berkenalan maupun berbincang-bincang satu sama lain. Perjalanan menuju Telaga Cebong pasti lebih asyik, seru serta bersemangat.Selain bentuknya mirip kecebong, telaga ini dikelilingi ladang sawah milih petani-petani setempat. Sehingga, bagus sekali sebagai latar foto. Kamu bisa selfie atau mengabadikan gambar telaga cebong yang unik.\r\n\r\n<strong>Fasilitas Telaga Cebong Dieng Wonosobo</strong>\r\n\r\nSebagai wisata alam dengan banyak pesona, tentulah selalu ramai dikunjungi. Untuk mendukung kegiatan wisatawan, telaga cebong memiliki fasilitas lengkap. Terdapat area parkir kendaraan, kamar mandi, mushola, tempat istirahat, warung-warung dan masih banyak lagi.Terdapat beberapa homestay tempat kamu menginap seperti homestay cahaya, homestay sikunir, karunia homestay dan lainnya. Harga penginapan cukup terjangkau, fasilitasnya lengkap serta menawarkan view menarik.\r\n\r\n<strong>Letak dan Cara Menuju Telaga Cebong Dieng Wonosobo</strong>\r\n\r\nAlamat objek wisata Telaga Cebong adalah di Desa Sembungan, Kejajar, Kabupaten Wonosobo, Jawa Tengah. Kamu dapat menggunakan kendaraan pribadi atau kendaraan umum saat kesana. Jika menggunakan kendaraan pribadi bisa mengandalkan google maps.Kalau dengan kendaraan umum, berhenti di terminal bus Kejajar. Lalu, lanjutkan perjalanan menggunakan ojek ke lokasinya.Sekarang kalian sudah tahu bagaimana keindahan alam telaga cebong dieng wonosobo, wisata pelengkap menuju bukit sikunir. Rencanakan liburan bersama orang-orang tercinta, terutama yang mempunyai hobi trekking. Jangan lupa bawa kamera agar dapat mengabadikan momen bahagia saat berkunjung ke objek wisata ini.', 'Telaga Cebong', '', 'publish', 'open', 'open', '', 'telaga-cebong', '', '', '2019-02-21 10:04:15', '2019-02-21 03:04:15', '', 0, 'http://localhost/wonosobo/?p=163', 0, 'post', '', 0),
(164, 1, '2019-02-21 10:02:46', '2019-02-21 03:02:46', '', 'telaga-cebong-dieng', '', 'inherit', 'open', 'closed', '', 'telaga-cebong-dieng', '', '', '2019-02-21 10:02:46', '2019-02-21 03:02:46', '', 163, 'http://localhost/wonosobo/wp-content/uploads/2019/02/telaga-cebong-dieng.jpg', 0, 'attachment', 'image/jpeg', 0),
